}

export const Footer = ({ }: Props) => {
    return (
        <div style={{ backgroundColor: "#fff" }}>
            <div style={{ flex: 1, backgroundColor: "#f00" }}>
                <div style={{ padding: 10 }}>Test</div>
                <div style={{ padding: 10 }}>Test</div>
            </div>
            <div style={{ flex: 1, backgroundColor: "#ff0" }}></div>
            <div style={{ flex: 1, backgroundColor: "#00f" }}></div>
        </div>
    )
}
